import React from "react";
import * as S from "./header_s";

const Header = () => {
  return (
    <header>
      <div className="conteiner">
        <S.logo h1 className="logo">SKY</S.logo>
        <p className="about the project"></p>
      </div>
    </header>
  );
};
export default Header;
